import React, { Suspense } from "react";
import "../style/App.scss";
import Particles from 'react-particles-js';

// Elements
import particles from "../constants/Particles";
import gameElements from "../constants/GameElements";


//Components
import HeaderText from "../components/HeaderText";
import GameDevelopment from "./GameDevelopment";
//pages
import Timeline  from "./Timeline";
import AboutMe from "./AboutMe";

import { TagCloud } from 'react-tagcloud'




function Homepage() {
  const data = [
    { value: 'jQuery', count: 25 },
    { value: 'MongoDB', count: 18 },
    { value: 'JavaScript', count: 38 },
    { value: 'React', count: 30 },
    { value: 'Nodejs', count: 28 },
    { value: 'Express.js', count: 25 },
    { value: 'HTML5', count: 33 },
    { value: 'CSS3', count: 20 },
    { value: 'Webpack', count: 22 },
    { value: 'Babel.js', count: 7 },
    { value: 'ECMAScript', count: 25 },
    { value: 'Jest', count: 15 },
    { value: 'Mocha', count: 17 },
    { value: 'React Native', count: 27 },
    { value: 'Angular.js', count: 30 },
    { value: 'TypeScript', count: 15 },
    { value: 'Flow', count: 30 },
    { value: 'NPM', count: 11 },
  ]
    document.body.style.backgroundImage = "radial-gradient(circle, rgb(15, 24, 29), rgb(12, 19, 22), rgb(5, 8, 8))"
    return (
          <div className="app">
            <Particles 
              className="particles"
              params={particles}
            />
            <HeaderText/>
            <TagCloud
              minSize={12}
              maxSize={35}
              tags={data}
              style={{ width: 300, textAlign: 'left' }}
              className="myTagCloud"
            />
            <AboutMe />
            <Timeline />



          </div>
    );
  }

export default Homepage
